import React from 'react';

export default function ClientDashboard() {
  return (
    <div style={{ margin: '20px' }}>
      <h2>Client Dashboard</h2>
      <ul>
        <li>Create New Gig</li>
        <li>View My Gigs</li>
        <li>Review Applications</li>
        {/* Add client-specific options */}
      </ul>
    </div>
  );
}
